import React from 'react';

const CarouselControls = ({ onNext, onPrev }) => {
  return (
    <div className="carousel-controls">
      <button onClick={onPrev} className="carousel-control carousel-control-prev">
        &lt;
      </button>
      <button onClick={onNext} className="carousel-control carousel-control-next">
        &gt;
      </button>
    </div>
  );
};

export default CarouselControls;
